// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MintConfig {
    address public owner;
    uint256 public startTime;

    string[] candidates;

    error Unauthorized();
    error TooEarly();
    error TooLate();
    error Empty();
    event Mint(string url, address indexed sender);

    modifier onlyBy(address _account) {
        if (msg.sender != _account) revert Unauthorized();
        _;
    }

    modifier onlyAfter(uint256 _time) {
        if (block.timestamp < _time) revert TooEarly();
        _;
    }

    modifier onlyBefore(uint256 _time) {
        if (block.timestamp > _time) revert TooLate();
        _;
    }

    constructor(uint256 _startTime, address _owner) {
        startTime = _startTime;
        candidates = new string[](0);
        owner = _owner;
    }

    function addBatch(string[] calldata _candidates)
        public
        onlyBy(owner)
        onlyBefore(startTime)
    {
        for (uint256 i = 0; i < _candidates.length; i += 1) {
            candidates.push(_candidates[i]);
        }
    }

    function random() private view returns (uint256) {
        return
            uint256(
                keccak256(abi.encodePacked(block.difficulty, block.timestamp))
            );
    }

    function getOne() public view returns (string memory) {
        uint256 rand = random();
        return candidates[rand % candidates.length];
    }

    function popOne() public returns (string memory) {
        if (candidates.length == 0) {
            revert Empty();
        }
        uint256 rand = random();
        uint256 idx = rand % candidates.length;
        string memory element = candidates[idx];
        candidates[idx] = candidates[candidates.length - 1];
        candidates.pop();
        emit Mint(element, msg.sender);
        return element;
    }

    function getAll() public view returns (string[] memory) {
        return candidates;
    }
}

contract Machine {
    address public owner = msg.sender;

    event Create(address indexed configAddress, address indexed sender);

    function create(uint256 timestamp) public returns (address configAddress) {
        address config = address(new MintConfig(timestamp, msg.sender));
        emit Create(config, msg.sender);
        return config;
    }
}
